import './App.scss';


function App() {
  return (
    <BrowserRouter>
    <div className="container">
      <Switch>
      <h1>First page</h1>
      <Route></Route>
      <Route></Route>
      </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
